translated_text:
Kazakh: Гаитидегі әділет және демократия институты БҰҰ Непал бейбітшіл батальоны өздері байқамай ауруды Гаитиге әкелген деп пайымдайтын тәуелсіз зерттеулерді көрсетті. 
English:
Kazakh: The Kazakhstani Ministry of Education and Science has been established in the framework of the State Council of the Republic of Kazakhstan. The Ministry is responsible for the development of education and science in the country. The Ministry is headed by a Minister. The Ministry is divided into the following departments:
1. The Department of Education and Science;
2. The Department of Science and Technology;
3. The Department of Higher Education;
4. The Department of Scientific Research;
